import React, { Component } from 'react';

class SideWidget extends Component {

    constructor(props) {
        super(props);
        this.createListOfVideos = this.createListOfVideos.bind(this);
    }

    componentDidMount() {
            fetch('/jsonContent/videos.json').then((response) => {
                return response.json();
            }).then((json) => {
                console.log("Json:", json);
                this.createListOfVideos(json);
            })
    }

    createListOfVideos(json) {

        return json.map((json, i) => (
            <tr key={i}>
                <td>
                    <p>{json.Video}</p>
                </td>
            </tr>
        ));
    }
   

    render() {

        return (
            <div>
                {this.createListOfVideos}
            </div>
        );
    }
}

export default SideWidget;
